Since our recent transfer (and Covid, really) I've been doing so much more outside of my comfort zone- some by choice and some not so much. 

Back to slow living here in Hawaii (which I've desperately been craving since leaving Kodiak, Alaska- what is it about islands!?) and increased family time due to Covid, I've been put into a lifestyle that I unknowingly have been desiring. A simple, intentional way of living. I've learned recently that being busy does not mean being fulfilled. 

In an effort to "unbusy" our lives and make room for the more important things, I've decided to move on from my photography buisness. Don't worry, my love for photography is still very present in my heart, and you will continue to see a lot of it here! 
For those of you that know me personally, you know I've taken on the challenge of homeschooling my two preschool age children this year. This came with some resistance, but I have to say, I'm loving (almost) every minute of it! And, as far as my professional life goes, I've made some changes there as well. I've decided to leave general practice after 12 years to continue my dental hygiene career in the pediatrics field. 

With this tour, we plan on doing a lot more minimalist, purposeful living (hence the name change!) As always, I'll be sharing our journey along the way!

